import React from 'react'
import styled from 'styled-components'

const Navbarall = styled.div`
width : 100%;
height : 70px;
border : solid 1px black;
display : flex;
align-items : center;
justify-content : space-between
`


const Imgdiv = styled.div`
width  : 10%;
height : 60px;
border : solid 1px red
`




function Navbar() {



  return (
    <div>
    <Navbarall>
    <Imgdiv>
    <img src = "https://techengage.com/wp-content/uploads/2019/03/whatsapp-dark-mode.jpg" className = "img-fluid"/>
    </Imgdiv>
    </Navbarall>
    </div>
  )
}

export default Navbar
